import Yelp from './yelp.png';
import './Logo.css';
import Tilt from 'react-tilt';

function Logo({}) {
  return (
    <div>
      <Tilt
        className="Tilt"
        options={{ max: 25 }}
        style={{ height: 350, width: 250 }}
      >
        <img src={Yelp} />
      </Tilt>
    </div>
  );
}

export default Logo;
